INSERT INTO `film` VALUES (10000,'DORAEMON  Nobita\'s New Dinosaur (2020)','Nobita hatches two new dinosaurs, named Kyu and Myu, via the Time Cloth. Nobita nurtures and takes care of these dinosaurs, to prove to his friends that he can find a real dinosaur. Once the dinosaurs are of age, Nobita shows them to Shizuka, Gian, and Suneo.',118,'Animation','Kazuaki Imai',NULL,'2020-11-25','Vienamese. English','/images/doraemon.jpg'),(10001,'SAI GON IN THE RAIN','Saigon In the Rain is a story about love & dreams of young people from all over the world who find each other in Saigon and then get lost in the middle of Saigon. And you? Can I meet my ‘youthfulness’ in the first rain of the season?',107,'Drama','','Avin Lu, Ho Thu Anh','2020-11-20','Vietnamese','/images/saigonintherain.jpg'),(10002,'THE WITCHES','Based on the book by Roald Dahl, The Witches is a story about a little boy and his kindly grandmother thwart the efforts of a coven of witches to rid Britain of children by turning them into mice.',94,'Adventure, Comedy, Family','Robert Zemeckis','Anne Hathaway, Octavia Spencer','2020-12-01','English, Vietnamese','/images/thewitches.gif'),(10003,'SOUL','A musician who has lost his passion for music is transported out of his body and must find his way back with the help of an infant soul learning about herself.',100,'Adventure, Animation','Pete Docter','Tina Fey, Jamie Foxx','2020-12-12','English, Vietnamese','/images/soul.jpg'),(10004,'WONDER WOMAN','Fast forward to the 1980s as Wonder Woman’s next big screen adventure finds her facing two all-new foes: Max Lord and The Cheetah, while reuniting with her past love Steve Trevor.',120,'Action, Fantasy','Patty Jenkins','Gal Gadot, Chris Pine','2020-12-20','English, Vietnamese','/images/wonderwoman.gif'),(10005,'PAWN','Du-seok (SUNG Dong Il) and Jong-bae (KIM Hiewon) are tough-rough private loan sharks who chase down a debtor to collect but end up taking Seung-yi (PARK Soi), a 9-year-old girl, as a pawn. “What does pawn mean?” Without even knowing what it means, Seung-yi becomes a pawn due to her mother’s misfortunes.',113,'Comedy, Drama','Kang Dae Kyu','Sung Dong Il, Ha Ji Won','2020-12-15','English','/images/pawn.jpg'),(10006,'SKYLIN3S','SKYLIN3S - The American science fiction disaster trilogy, about the life on Earth after 15 years from the second movies. When a virus threatens to turn the now earth-dwelling friendly alien hybrids against humans, Captain Rose Corley must lead a team of elite mercenaries on a mission to the alien world in order to save whats left of humanity.',114,'Action, Drama','Liam O\'Donnell','Lindsey Morgan, Rhona Mitra, Alexander Siddig','2020-12-17','English','/images/SKYLIN3S.jpg'),(10007,'DEMON SLAYER – MUGEN TRAIN','Falling forever into an endless dream.. Tanjiro and the group have completed their rehabilitation training at the Butterfly Mansion, and they arrive to their next mission on the Mugen Train, where over 40 people have disappeared in a very short period of time. Tanjiro and Nezuko, along with Zenitsu and Inosuke, join one of the most powerful swordsmen within the Demon Slayer Corps, Flame Hashira Kyojuro Rengoku, to face the demon aboard the Mugen Train on track to despair.',117,'Animation','Haruo Sotozaki','Natsuki Hanae, Akari Kito, Hiro Shimono, Yoshitsugu Matsuoka, Satoshi Hino','2020-12-20','Japanese with English and Vietnamese subtitles','/images/demonslayer.jpg'),(10008,'EXTREME JOB','A team of narcotics detectives goes undercover in a fried chicken joint to stake out an organized crime gang. But things take an unexpected turn when the detectives’ chicken recipe suddenly transforms the rundown restaurant into the hottest eatery in town.',111,'Action, Comedy','','Ryu Seung-yong, Lee Hanee, Jin Sun-kyu, Lee Dong-hwi, Gong Myoung','2020-12-31','Vietnamese','/images/nghesieukho.jpg');
